describe('to test the title and URL of the browser', () => {
    
    before(() => {
        browser.url('https://www.amazon.in');
    });

   after(() => {
       console.log("completed successfully");
   });
   
   
    it('should have correct title', () => {
        expect(browser).toHaveTitle("Amazon.in Great Indian Festival 2021");
    });

    it('should have content in the title', () => {
        expect(browser).toHaveTitleContaining("Great Indian");
    });

    it('should have correct URL', () => {
        expect(browser).toHaveUrl("https://www.amazon.in");
    });

    it('should have content in the URL', () => {
        expect(browser).toHaveUrlContaining("amazon.in");

    });
});

