import { expect as chaiExpect } from 'chai';
import ChaiPage from '../pages/chaipage';
describe('validation of amazon application', () => {
    it('should have correct title of an application', async () => {
        ChaiPage.open();
        //browser.url ('http://www.amazon.in');
        expect(browser).toHaveTitle("Online Shopping site in India: Shop Online for Mobiles, Books, Watches, Shoes and More - Amazon.in");
        await browser.pause(2000);
    });

    it('should have correct URL of an application', async () => {
        expect(browser).toHaveUrl("https://www.amazon.in");
        await browser.pause(2000);
    });
    it('search button',async () => {
        //const txtSearchBox = await $('#twotabsearchtextbox');
        await ChaiPage.txtSearchBox.waitForClickable({timeout:2000});
        await ChaiPage.txtSearchBox.setValue("watches");
        //const btnSearch = await $('#nav-search-submit-button');
        await ChaiPage.btnSearch.click();
        await browser.pause(3000);

        let currentUrl = await browser.getUrl();
        console.log(currentUrl);
        chaiExpect(currentUrl).to.be.include('watches');

        const product = await $(`//span[text()='TIMEWEAR']/preceding::img[1]`);
        await product.click();
        let handles = await browser.getWindowHandles();
        await browser.switchToWindow(handles[1]);
        const productName = await $('#productTitle').getText();
        chaiExpect(productName).to.be.include("TIMEWEAR");
    });
});

